Insert into tasks_meta (OLD_ID,OLD_PARENT_ID,OLD_NAME,NEW_ID,NEW_PARENT_ID,NEW_NAME) select id as OLD_ID, parent_id as OLD_PARENT_ID, name as OLD_NAME, id as NEW_ID, 31 as NEW_PARENT_ID, name as NEW_NAME from tasks where id not in (select old_id from tasks_meta) and parent_id = 7;
